import { Grid, Typography } from '@mui/material';
import React from 'react';
import NavigateNextIcon from '@material-ui/icons/NavigateNext';
import Breadcrumbs from '@material-ui/core/Breadcrumbs';
import { Link, Paper } from '@material-ui/core';
import { useTheme } from '@material-ui/core/styles';
import { makeStyles } from '@material-ui/core/styles';
import { Box } from '@mui/system';

const useStyles = makeStyles((theme) => ({
    faded: {
        color: theme.palette.fadedtext.main,
    },
    containerBox: {
        marginTop: theme.spacing(4),
        marginBottom: theme.spacing(4),
    },
    paperEconom: {
        backgroundColor: theme.palette.primary.main,
        padding: theme.spacing(1),
        width: '50%',
    },
    paperBusiness: {
        backgroundColor: '#33499a',
        padding: theme.spacing(1),
        width: '100%',
    },
    lightText: {
        color: theme.palette.primary.contrastText,
    },
}));

function handleClick(event) {
    /* event.preventDefault();
    console.info('You clicked a breadcrumb.'); */
}

function ViewFlight() {
    const url = window.location.href;
    const flightCode = url.substring(url.lastIndexOf('/') + 1);
    const theme = useTheme();
    const classes = useStyles();

    //TODO fetch info about flight
    const flight = {
        id: 'KPNL145',
        destination: 'London',
        business_remaining: 1,
        econom_remaining: 1,
    };

    return (<div>
        <Breadcrumbs separator={<NavigateNextIcon fontSize="small" className={classes.faded}/>} aria-label="breadcrumb">
            <Typography>
                <Link href="/" onClick={handleClick} className={classes.faded}>
                    Browse Flights
                </Link>
            </Typography>
            <Typography color={theme.palette.primary.main}>View Flight</Typography>
        </Breadcrumbs>

        <Box
            className={classes.containerBox}
        >
            <Grid container spacing={2} alignItems="center">
                <Grid item xs={12}>
                    <Typography variant='h2'>{flightCode}</Typography>
                </Grid>

                <Grid item xs={12} sm={2} lg={2}>
                    <Typography >Destination:</Typography>
                </Grid>
                <Grid item xs={12} sm={10} lg={10}>
                    <Typography >{flight.destination}</Typography>
                </Grid>

                <Grid item xs={12} sm={2} lg={2}>
                    <Typography >Blah:</Typography>
                </Grid>
                <Grid item xs={12} sm={10} lg={10}>
                    <Typography >blah</Typography>
                </Grid>

                <Grid item xs={2}>
                    <br/>
                </Grid>
                <Grid item xs={2}>
                    <Paper elevation={3} className={classes.paperEconom}>
                            <Typography className={classes.lightText}>Econom</Typography>
                        <Typography
                            style={{ textAlign: 'center' }}
                            className={classes.lightText}
                        >
                            {flight.econom_remaining}
                        </Typography>
                    </Paper>
                </Grid>
                    <br />
                <Grid item xs={1}>
                </Grid>
                <Grid item xs={2}>
                    <Paper elevation={3} className={classes.paperBusiness}>
                        <Typography className={classes.lightText}>Business</Typography>
                        <Typography
                            style={{ textAlign: 'center' }}
                            className={classes.lightText}
                        >
                            {flight.business_remaining}
                        </Typography>
                    </Paper>
                </Grid>
                <Grid item xs={2}>
                    <br />
                </Grid>

            </Grid>
        </Box>
    </div> );
}

export default ViewFlight;
